import React from 'react';
import  "./Maincard2.css";
import tree from "../../Assets/tree.jpg";

export default function Maincardd2() {
  return (
    <div className="maincard">
        <img className="img" src={tree} alt="" />
        <input className="text" type="text" placeholder="What's in your mind?  " />
        <hr />
        <div className="linktags">
        <span class="material-symbols-outlined" id="Picon">photo_library</span>
            <span className="tags" >Photos & Videos</span>
            <span class="material-symbols-outlined" id="Ticon">label</span>
            <span className="tags">Tags</span>
            <span class="material-symbols-outlined" id="Licon">location_on</span>
            <span className="tags">Location</span>
            <span class="material-symbols-outlined" id="Ficon">mood</span>
            <span className="tags">Feelings</span>
            
            <button className="button">Share</button>
          
        </div>
    </div>
  )
}
